description:
The Central Park Five

Sociopolitical Documentary hosted by Ken Burns, published by PBS in 2013 - English narration


Information
------------------------------

In 1989, five black and Latino teenagers were arrested and charged for brutally attacking and raping a white female jogger in Central Park. News media swarmed the case, calling it &quot;the crime of the century.&quot; But the truth about what really happened didn't become clear until after the five had spent years in prison for a crime they didn't commit. With THE CENTRAL PARK FIVE, this story of injustice finally gets the telling it deserves. Based on Sarah Burns' best-selling book and co-directed by her husband David McMahon and father, the beloved doc filmmaker Ken Burns, this incendiary film tells the riveting tale of innocent young men scapegoated for a heinous crime, and serves as a mirror for our times.

